import React,{useState} from 'react';
import logo from '../images/1920px-Netflix_2015_logo.svg.png';
import './LogInScreen.css';
import SignIn from '../components/SignIn';
import SignUp from '../components/SignUp';
const LogInScreen = () => {
    const [logedIn, setLogedIn] = useState(false);
    const logInClicked = () =>{
        setLogedIn(true);
    }
    return(
        <div className='logInScreen'>
            <div className='logInScreen__nav '>
                <img className='logInScreen__logo' src={logo} alt='Netflix-Logo'/>
                <button className='logInScreen__button' style={{display: logedIn? 'none' : 'block' }} onClick={logInClicked}>SignIn</button>
            </div>
            {logedIn ? <SignUp/>
            : <SignIn logInClicked={logInClicked}/>
            }
            
        </div>
            
        
    )
}

export default LogInScreen;
